import React, { Fragment } from "react";
import Banner from "../layout/Banner"

const Home = () => {
  return (
    <Fragment> 
    <div className="home">
    <Banner/>
    </div>
    <div> 
      <h1> This is the home page </h1> 
    </div>
    </Fragment>
  );
};

export default Home;
